import Card from './Card';

const CardList = ({ robots }) => {
    const cardArray = robots.map((_user, i) => {
        return <Card key={id} id={robots[i].id} name={robots[i].name} email={robots[i].email}/>
    })  
    return (  
        <div>
            {cardArray}           
        </div>
    );
}

export default CardList;
